import React from "react";
import {Calendar} from "primereact/calendar";

function Booking() {

    let date;

    function setDate(value) {
        return undefined;
    }

    return (
        <div className="form">
            <h3>Boka tid</h3>
            <Calendar inline value={date} onChange={(e) => setDate(e.value)}></Calendar>
        </div>
    );
}
export default Booking;
